import Expense from "./Expense"

function NewExpenses(props){

    const expenses = [
        {
          id: 'e1',
          title: 'Toilet Paper',
          amount: 94.12,
          date: new Date(2020, 7, 14),
        },
        { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
        {
          id: 'e3',
          title: 'Car Insurance',
          amount: 294.67,
          date: new Date(2021, 2, 28),
        },
        {
          id: 'e4',
          title: 'New Desk (Wooden)',
          amount: 450,
          date: new Date(2021, 5, 12),
        },
      ];
        return (
        <div>
      <Expense title={props.expenses[0].title} amount={props.expenses[0].amount} date={props.expenses[0].date} ></Expense>
      <Expense title={props.expenses[1].title} amount={props.expenses[1].amount} date={props.expenses[1].date} ></Expense>
      <Expense title={props.expenses[2].title} amount={props.expenses[2].amount} date={props.expenses[2].date} ></Expense>
      <Expense title={props.expenses[3].title} amount={props.expenses[3].amount} date={props.expenses[3].date} ></Expense>
      </div>
    )
}

export default NewExpenses;
